namespace BloomWCFService.Data.Migrations.BouquetDB
{
    using BloomWCFService.Models;
    using Newtonsoft.Json;
    using System;
    using System.Collections.Generic;
    using System.Data.Entity;
    using System.Data.Entity.Migrations;
    using System.Linq;
    using System.Text;

    internal sealed class Configuration : DbMigrationsConfiguration<BloomWCFService.Data.BouquetDbContext>
    {
        public Configuration()
        {
            AutomaticMigrationsEnabled = false;
            MigrationsDirectory = @"Data\Migrations\BouquetDB";
        }

        protected override void Seed(BloomWCFService.Data.BouquetDbContext context)
        {
            String bouquetListBase64JSON = "";

            String bouquetListJSONString = Encoding.UTF8.GetString(Convert.FromBase64String(bouquetListBase64JSON));

            List<Bouquet> bouquetList = JsonConvert.DeserializeObject<List<Bouquet>>(bouquetListJSONString);

            context.Bouquets.AddRange(bouquetList);
        }
    }
}
